import React from "react";
import "./Workout.css";

const Workout = () => {
  return (
    <div className="workout">
      <div className="container">
        <i
          className="fa-solid fa-dumbbell"
          style={{ color: "#fffff", fontSize: "1.5rem" }}
        />
        <p>Workout</p>
      </div>
    </div>
  );
};

export default Workout;
